import styled from 'styled-components';
import Logo from '../../images/logo.svg';

const LogoContainer = styled.div`
    display: flex;
    font-size: 1.875rem;
`;

const LogoImg = styled.img`
    margin-right: 0.625rem;
`;

function logo() {
    return (
        <LogoContainer>
            <img
                src={Logo}
                alt='logo'
                className='logo-img'
            ></img>
            <p>
                <strong>Alura</strong>Books
            </p>
        </LogoContainer>
    )
};

export default logo
